import Foundation

enum MaximumProductOfWordLengths {
    
    class Solution {
        func maxProduct(_ words: [String]) -> Int {
            var maxLength: Int = 0
            var lettersMap: [Character: Set<Int>] = [:]
            
            let sortedWords = words.sorted(by: { $0.count > $1.count })
            let absoluteMaxLength = sortedWords[0].count * sortedWords[1].count
            
            for i in 0..<sortedWords.count {
                var set = Set<Character>()
                for index in 0..<sortedWords[i].count where set.count != 26 {
                    let word = sortedWords[i]
                    let char = word[word.index(word.startIndex, offsetBy: index)]
                    set.insert(char)
                    lettersMap[char, default: Set<Int>()].insert(i)
                }
                
                var indexesSet = Set<Int>(0..<i)
                
                for char in set where !indexesSet.isEmpty {
                    let usedIndexes = lettersMap[char, default: Set<Int>()]
                    indexesSet = indexesSet.subtracting(usedIndexes)
                }
                
                if !indexesSet.isEmpty {
                    for index in indexesSet {
                        maxLength = max(maxLength, sortedWords[index].count * sortedWords[i].count)
                    }
                }
                
                if maxLength == absoluteMaxLength {
                    return maxLength
                }
            }
            
            return maxLength
        }
    }
}

